  [],\n\t\"revision_timestamp\": \"2015-05-06T22:04:09.644979\",\n\t\"name\": \"engine-test-stand-design-constraints-expert-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Propulsion test stands are designed for
  thermal and pressure loads for certain classes of engines.   These plume induced
  loads are:  radiative heating, acoustics and direct impingement convective heating
  and pressure loads.  Existing test stands will be used to test a wide variety of
  new propulsion systems, engines and engine components which will require the evaluation
  of the test stand design to handle loads that are a function of engine location,
  chamber pressure history and gimbaling.  Existing models require large numbers of
  individual calculations to evaluate the various engine operating parameters.  The
  Phase I effort will utilize existing models to develop a PC based test stand design
  constraints model that automatically determines engine operating limits for existing
  facilities.  The Phase I effort will establish test stand design data base requirements,
  modify existing test stand environments models to automatically cycle through the
  entire range of engine operating parameters for a single design variable, and demonstrate
  the model for an existing stand.  The Phase II effort expands the models capabilities
  for all design constraints and develops a CAD module for importing test stand design
  information.  This effort is innovative in that it will greatly reduce the cost/time
  for testing new engine designs.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
